import React from 'react';
import logo from './logo.svg';
import './App.css';


function ActionLink() {
  function handleClick(e) {
    e.preventDefault();
    console.log('The link was clicked.');
  }

  return (
    <a href="#" onClick={handleClick}>
      Click me
    </a>
  );
}

function App() {
  return (
    <div className="App">
      <ActionLink />
    </div>
  );
}

export default App;
